import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import './App.css';

function Home() {
  return (
    <section className="hero">
      <h1>Bienvenidos a Fondos.com</h1>
      <p>Tu sitio de informaci√≥n y servicios financieros</p>
    </section>
  );
}

function App() {
  return (
    <Router>
      <div className="background-container">
        <header className="header">
          <div className="logo">fondos.com</div>
          <Link className="navItem" to="/">
            <img src="/home.png" alt="Home" />Home
          </Link>
          <Link className="navItem" to="/contacto">
            <img src="/down.svg" alt="Contacto" className="icon" />Contacto
          </Link>
          {/* Otros enlaces */}
        </header>
        <Routes>
          <Route path="/" element={<Home />} />
          {/* Otras rutas */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
